    useEffect(()=>{
        document.title = "Chats${my}"
    },[])

    return (
        <>
            <div className='container'>
                <p>{myNum}</p>
                <div>
                    <button onClick={() => {
                        setMyNum(myNum + 1)
                    }}>INC</button>
                </div>

            </div>
        </>
    )
}

